def google_search(query, num_results, lang):
    service = build("customsearch", "v1", developerKey=GOOGLE_API_KEY)
    results = (
        service.cse()
        .list(q=query, cx=CUSTOM_SEARCH_ENGINE_ID, num=num_results, gl=lang)
        .execute()
        .get("items", [])
    )

    formatted_results = [[result["title"], result["link"], result["snippet"]] for result in results]

    return {"results": formatted_results}

def extractive_summary(text, num_sentences=3):
    """
    Summarizes the text by selecting the most relevant sentences.
    """
    # Split the text into sentences
    sentences = [sentence.strip() for sentence in text.split('.') if sentence]

    # If there are fewer sentences than our desired number, return the whole text
    if len(sentences) <= num_sentences:
        return ' '.join(sentences)

    # Use CountVectorizer to convert sentences into vectors
    vectorizer = CountVectorizer().fit_transform(sentences)
    vectors = vectorizer.toarray()

    # Calculate cosine similarity
    cosine_matrix = cosine_similarity(vectors)
    scores = cosine_matrix.sum(axis=1)

    # Get indices of sentences with the highest scores
    ranked_sentences = [sentences[i] for i in np.argsort(scores, axis=0)[-num_sentences:]]

    return ' '.join(ranked_sentences)

def abstractive_summary(text, num_clusters=3):
    """
    Summarizes the text using sentence embeddings and clustering.
    """
    # Split the text into sentences
    sentences = [sentence.strip() for sentence in text.split('.') if sentence]

    # If there are fewer sentences than our desired number of clusters, return the whole text
    if len(sentences) <= num_clusters:
        return ' '.join(sentences)

    # Use SentenceTransformer to get sentence embeddings
    model = SentenceTransformer('paraphrase-MiniLM-L6-v2')
    embeddings = model.encode(sentences)

    # Cluster the embeddings
    kmeans = KMeans(n_clusters=num_clusters)
    kmeans.fit(embeddings)
    cluster_centers = kmeans.cluster_centers_

    # For each cluster, pick the sentence closest to the cluster center
    summary_sentences = []
    for center in cluster_centers:
        distances = np.linalg.norm(embeddings - center, axis=1)
        closest_sentence = sentences[np.argmin(distances)]
        summary_sentences.append(closest_sentence)

    return ' '.join(summary_sentences)


def get_webpage_text(url):
    downloaded = trafilatura.fetch_url(url)
    text = trafilatura.extract(downloaded)

    if text is None:
        return " "

    extract = extractive_summary(text)
    return extract

