def unify_similar_entity(df, threshold=90):
    df['Entity'] = df['Entity'].astype(str)  # Convert 'Entity' column to string
    entities = df['Entity'].unique()
    for entity in entities:
        matches = process.extract(entity, entities, limit=len(entities), scorer=fuzz.token_sort_ratio)
        similar = [match[0] for match in matches if match[1] >= threshold and match[0] != entity]
        if similar:
            for similar_entity in similar:
                df['Entity'] = df['Entity'].replace(similar_entity, entity)
    return df


def decode_to_utf8(data):
    """
    Essaie de dcoder les donnes en UTF-8 ou corrige les erreurs d'encodage.
    """
    try:
        # Dcodage direct en UTF-8
        return data.decode('utf-8')
    except (UnicodeDecodeError, AttributeError):
        # Si chec, essayer latin1
        return data.decode('latin1').encode('utf-8').decode('utf-8')


def normalize_text(text):
    """
    Normalise le texte pour corriger les caractres spciaux mal affichs.
    """
    return unicodedata.normalize('NFKC', text)


def clean_text(data):
    """
    Nettoie et normalise le texte pour viter les caractres mal encods.
    """
    # tape 1 : Dcodage des donnes
    if not isinstance(data, str):  # Si les donnes sont en bytes
        try:
            decoded_data = decode_to_utf8(data)
        except Exception as e:
            print(f"Error during decoding: {e}")
            decoded_data = data.decode('latin1', errors='replace')
    else:
        decoded_data = data

    # tape 2 : Normalisation Unicode
    normalized_data = normalize_text(decoded_data)

    return normalized_data

